Производитель – EDEA (Италия);
Уровень катания - базовый;
Цвет - чёрный;
Размеры: 195-310 мм (с шагом в 5 мм);
В комплекте с лезвиями Balance;
Индекс жесткости ботинка – 48;
Материал ботинка - натуральная кожа с водоотталкивающим покрытием;
Сниженный вес ботинка, засчёт специальной конструкции подошвы и каблука;
Внутренняя подкладка (набивка) антибактериальная – микрофибра;
Классическая колодка;
Ботинок быстро сохнет;
Подошва из литого пластика облегчённая с защитой от влаги;
Усиленные крюки шнуровки ботинка;
Вентиляция ботинка;
Мягкий язычок, принимающий анатомическую форму стопы.

